import './style.scss';
import TrendingComp from './trending-components';

const Trending = () => {

return(
    <div className='trending'>
<div className="title">
    <p className="titletxt">Trending</p>
</div>

<div className="items">
    {tradingutil.map(el => <TrendingComp key={el.id} items />)}
</div>

    </div>
)
}

export default Trending
